import React from 'react';
import style from './Post.module.css';

const Posts = (props) => {
    return (
        <div className={style['posted-property-container']}>
            <div className={style['price']}>{props.data.price}</div>
            <div className={style['desc']}>{props.data.desc}</div>
            <div>No. of Bedrooms:{props.data.bedrooms}</div>
            <div>No. of Bathrooms:{props.data.bathroom}</div>
            <div>size:{props.data.areaSize}</div>
            <div className={style['post-address-container']}>
                <div>{props.data.address.city}</div>
                <div>{props.data.address.area}</div>
                <div>{props.data.address.pincode}</div>
            </div>
            <button>I am Interested</button>
        </div>
    );
};

export default Posts;
